import classes from './Home'

const History = () => {
    const quiz = useSelector((state) => state.quiz.history);
    console.log(quiz)
    return(
        <div>
            <div className={classes.cardicon}>
                <img src='../../assets/cardicon.svg' />
            </div>
            <div>
                <h5>English Grammar</h5>
                <div>
                    <label>Earnd</label>
                    <p>February 4th 2023</p>
                </div>
            </div>
            <div><img src='../assets/coin.png' /><span>10,000</span></div>
        </div>
    )
};

export default History;
